import './App.css';
import * as React from "react";
import {Route, Link, Routes, useNavigate, Router} from 'react-router-dom';
import Page1 from './adpage1';
function App() {
  const navigate = useNavigate();
  return (
    <>
    <Router Link to='/adpage1' >
    </Router>

    <button onClick={()=>navigate('/adpage1')}>Go to product</button>	
		</>
  );
}
export default App
